import React from 'react';
import Square from './Square';

class Game extends React.Component {
  constructor(props) {
    super(props);
    this.onClickHandler = this.onClickHandler.bind(this);
  }

  onClickHandler() {
    console.log('button clicked');
  }

  render() {
    return (
        <div>
            <Square onClick={this.onClickHandler} value="5" />
        </div>
    )
  }
}

export default Game;
